Keyakinan ini menjadikan perempuan Tengger menjalani kehidupan sehari-hari secara disiplin, penuh kerja keras, namun tetap ikhlas. Ada kepercayaan yang tertanam dalam batin setiap perempuan Tengger bahwa tugas seorang istri adalah mendampingi suami dalam ruang rumah tangga sekaligus ruang kerja.

Hidup bercocok tanam bagi warga Tengger, sudah dianggap sebagai bagian dari budaya Tengger.

Taat pada budaya sama saja menaati sesanti panca setya Tengger. Yaitu lima ajaran hidup suku Tengger, yakni setya budaya (taat, tekun bekerja, dan mandiri), setya wacana (setia pada ucapan), setya semaya (setia pada janji), setya laksana (patuh dan taat aturan), serta setya mitra (setia kawan).

Berpegang pada ajaran hidup itulah hingga tidak heran perempuan-perempuan Tengger dan hampir seluruh orang Tengger selalu bersungguh-sungguh bekerja termasuk dalam bertani.

Diselal-sela Kunjungan Kerja KASAD Jenderal TNI Andika Perkasa Jum'at kemarin, Bupati Probolinggo @tantrianasari berkesempatan berdialog dan memberi semangat kepada para petani Tengger yang sedang memanen bawang prei di lereng gunung Bromo.

Selalu sehat sobat...dan selamat menikmati akhir pekan bersama keluarga, jangan lupa pakai masker ya...

